  text-transform: none;
  letter-spacing: normal;
  line-height: 1.6em;
}
ul.accordion li .description a{
  position:absolute;
  bottom:5px;
  left:20px;
  text-transform:uppercase;
  font-style:normal;
  font-size:11px;
  text-decoration:none;
  color:#888;
}
ul.accordion li .description a:hover{
